// \u6B64\u5904\u53EF\u4EE5\u662F atomx \u6216 sharex \uFF0C\u770B\u7528\u6237\u5177\u4F53\u4F7F\u7528\u54EA\u4E00\u4E2A\uFF0C\u63A8\u8350\u5B57\u5178\u5BF9\u8C61\u6709\u6548\u8003\u8003 sharex
