export type State = typeof ctx.state; // \u72B6\u6001\u7C7B\u578B
export type Draft = DraftType<State>; // \u8349\u7A3F\u7C7B\u578B\uFF0CDraftType \u4F1A\u81EA\u52A8\u62C6\u7BB1 Atom \u7C7B\u578B\u503C\u51FA\u6765
